import React from "react";
import "./left-panel.css";

const LeftPanel = () => {
  const btns = [
    ["7", "8", "9"],
    ["4", "5", "6"],
    ["1", "2", "3"],
    ["0", ".", "AC"],
  ];
  return (
    <div className="leftPanel">
      {btns.map((bt, i) => (
        <div key={i} className="numbers">
          {bt.map((b) => (
            <div>{b}</div>
          ))}
        </div>
      ))}
    </div>
  );
};

export default LeftPanel;
